text:
@iambeckyg para @ladygunn 
con #metoo, time´s up y muchas otras iniciativas emocionantes dirigidas por mujeres que están sucediendo en el mundo en este momento, depende en parte de los gustos de becky g transmitir las ideas de igualdad y respeto propio a sus admiradores. y sus canciones latinas, contadas desde la perspectiva femenina, dieron un giro fresco muy necesario al género, a la vez que sirvieron como plataforma para el empoderamiento. ¿se siente orgullosa de que su canción haya sido censurada en españa? (un gran logro, si nos pregunta): "¡por supuesto que estaba orgulloso!" ¿pero cómo la artista encuentra ese empoderamiento a sí misma?
“tienes que encontrarlo desde dentro y también desde las personas con las que te rodeas. el equipo que tengo es increíble. me escuchan, lo que es muy raro en estos días para las mujeres. siento que somos muy rápidos para ser silenciados. también tengo un novio muy comprensivo y amoroso que nunca ha juzgado ninguna de mis ideas y solo las ha alentado ". cuando se le preguntó qué se siente ser una mujer en el año 2018, becky g no intenta endulzar el bote: "al igual que cualquier cosa en la vida, hay algo bueno y malo, hay algo positivo y otro negativo. una parte de mí se siente emocionada y muy liberada y otra parte de mí todavía siente que tenemos un largo camino por recorrer en la sociedad en lo que respecta al respeto que necesitamos y la igualdad que aún nos falta. es emocionante pero también revelador, esa es la palabra ". (2/9)

